import React, { useState } from "react";
import {FaGitHub, FaLinkin } from 'react-icons';
import {HiOutlineMail} from 'react-icons/hi';

function Nav(){
    let navBarClass = ''; //Variable I want to store the outcome of what link was clicked
    const [navClass, setClass] = useState(''); //Or I could use State

    //const handleClick = () => {};

    /*This is a functional component that renders out my navigation bar. It has links for Home,
    About Me and Contact me with an onClick event listener attached so when you click on one it changes
    which section gets displayed in your browser.*/
    return(
        <nav className="bg-dark">
            <div className="Name">
                <h1>Wendell Fowlkes</h1>
            </div>
            <div className="navLinks">
                <ul>
                    <li><a href="/">Home</a></li>
                    <li><a href="/about/">About</a></li>
                    <li><a href="#">Portfolio</a></li>
                    <li><a href="#">Contact</a></li>
                </ul>
            </div>
            <div className="flex fixed flex-col yop-[35%] left-0"></div>
        </nav>
    );
}
export default Nav;
